        value:
          '“因功能布局、规划指标、效果改变引起的设计变更”的事项认定，由区域设计部作出判断。\n项目部会签确认现场工程进度完成情况、责任单位；营销管理部会签涉及销售承诺事项，客户关系部会签涉及客服物业管理相关。可能影响报建的，需会签报批报建部门\n超过50万设计变更立项需工程管理部、产品中心论证\n成本减少即金额为负数时，以绝对值计',
